import React from "react";
import Products from "./ProductData";












const Product = () => {
  return (
    <div>
      {ProductData.map((product) => (
        <div key={product.id}>
          <div >{product.img}</div>
          <h2>{product.name}</h2>
          <div >{product.price}</div>
          <div >{product.description}</div>
          <div >{product.category}</div>

        </div>
      ))}
    </div>
  );
};

export default Products;
